import Card from 'react-bootstrap/Card';
import { useOutletContext } from "react-router-dom";

function Eater () {
    const data = useOutletContext();
    const handleHeaderClick = useOutletContext()[1];
    console.log(data)

    const itemArray = data.map((item, index)=> {
        // console.log(item.infatuation)
        const eachItem = item.eater.map((infatuation, index)=> {
            const {name, account, link, image, image_credit} = infatuation;
                return (
                    <Card key={index} style={{ width: '18rem' }}>
                        <Card.Img variant="top" src={image} alt={image_credit} />
                        <Card.Body>
                            <Card.Header onClick={() => handleHeaderClick(link)}>
                                <strong>
                                    {name}
                                </strong>
                            </Card.Header>
                            <Card.Text> By {account}</Card.Text>
                            {/* <Card.Link href={link}>Visit Article</Card.Link> */}
                        </Card.Body>
                    </Card>
                )
            })
        return (
            <div key={index}>
                {eachItem}
            </div>
        )
    })

    return (
        <>
            {itemArray}
        </>
    )

}

export default Eater
